import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [step, setStep] = useState(1);
  const [mahasiswa, setMahasiswa] = useState(null); // State untuk menyimpan data mahasiswa
  const currentDate = new Date().toLocaleDateString();

  // Ambil data mahasiswa berdasarkan token yang ada di localStorage
  useEffect(() => {
    const fetchMahasiswaData = async () => {
      try {
        const token = localStorage.getItem('token'); // Ambil token dari localStorage

        if (token) {
          // Set Authorization header dengan Bearer token
          const response = await axios.get('http://localhost:8000/api/mahasiswa/me', {
            headers: {
              Authorization: `Bearer ${token}`, // Kirim token di header
            },
          });

          setMahasiswa(response.data); // Menyimpan data mahasiswa ke state
        } else {
          console.log('Token tidak ditemukan');
        }
      } catch (error) {
        console.error('Error fetching mahasiswa data:', error);
      }
    };

    fetchMahasiswaData();
  }, []); // Effect hanya dijalankan sekali saat komponen pertama kali di-render
  return (
    <div className="flex flex-col h-screen bg-teal-100 font-sans">
      {/* Header */}
      <header className="bg-teal-200 text-teal-800 px-6 py-4 flex justify-between items-center shadow">
        <h1 className="text-xl font-bold">Panel Mahasiswa</h1>
        <div className="flex items-center">
          <span className="material-icons text-3xl mr-2">account_circle</span>
          <span>{mahasiswa ? mahasiswa.nama : 'Loading...'}</span>
        </div>
      </header>

      {/* Container */}
      <div className="flex flex-1 overflow-hidden">
        {/* Sidebar */}
        <aside className="w-48 bg-teal-700 text-white flex-shrink-0">
          <nav>
            <ul className="space-y-2 p-4">
              <li>
                <a
                  href="/Dashboard_m"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Dashboard
                </a>
              </li>
              <li>
                <a
                  href="/Jadwal_m"
                  className="block px-4 py-2 rounded hover:bg-teal-600"
                >
                  Jadwal
                </a>
              </li>
              {/* Removed the Pendaftar menu item */}
              <li>
                <a href="/Keuangan_m" className="block px-4 py-2 rounded hover:bg-teal-600">
                  Pembayaran
                </a>
              </li>
              <li>
                <a href="#" className="block px-4 py-2 rounded hover:bg-teal-600">
                  Presensi
                </a>
              </li>
              <li>
                <a href="/" className="block px-4 py-2 rounded hover:bg-teal-600">
                  Logout
                </a>
              </li>
            </ul>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="flex-1 bg-teal-50 p-6 overflow-y-auto">
          <h2 className="text-2xl font-bold mb-4">Jadwal</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full bg-white border border-teal-300 rounded-lg shadow">
              <thead className="bg-teal-700 text-white">
                <tr>
                  <th className="px-6 py-3 text-left font-medium">NIM : {mahasiswa.nim} </th>
                  <th className="px-6 py-3 text-left font-medium">Nama : {mahasiswa.nama}</th>
                  <th className="px-6 py-3 text-left font-medium">Alamat : {mahasiswa.alamat} </th>
                  <th className="px-6 py-3 text-left font-medium">
                    Tempat, Tgl Lahir : {mahasiswa.tempat}, {mahasiswa.tgl_lahir}
                  </th>
                  <th className="px-6 py-3 text-left font-medium">No. Tlp : {mahasiswa.no_telp}</th>
                  <th className="px-6 py-3 text-left font-medium">Email : {mahasiswa.email}</th>
                  <th className="px-6 py-3 text-left font-medium">
                    Status Pembayaran : {mahasiswa.status_pembayaran}
                  </th>
                </tr>
              </thead>
              <tbody>
                {schedules.length > 0 ? (
                  schedules.map((schedule) => (
                    <tr
                      key={schedule.id}
                      className="hover:bg-teal-100 border-t border-teal-300"
                    >
                      <td className="px-6 py-4">{schedule.id}</td>
                      <td className="px-6 py-4">{schedule.nama}</td>
                      <td className="px-6 py-4">{schedule.alamat}</td>
                      <td className="px-6 py-4">{schedule.ttl}</td>
                      <td className="px-6 py-4">{schedule.noTlp}</td>
                      <td className="px-6 py-4">{schedule.email}</td>
                      <td className="px-6 py-4">{schedule.statusPembayaran}</td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td
                      colSpan="7"
                      className="text-center px-6 py-4 text-gray-500"
                    >
                      Tidak ada jadwal tersedia.
                    </td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </main>
      </div>
    </div>
  );
};

export default Jadwal;
